import React from 'react';
import { Button } from '@mui/material';

// Update LoginButton to accept user prop to distinguish between user 1 and 2
const LoginButton = ({ user }) => (
    <Button
        variant="contained"
        color="primary"
        onClick={() => window.location = `http://localhost:3001/login?user=${user}`}
        style={{ fontWeight: 'bold' }}
    >
        {user === "first" ? "Log in with Spotify for the first user" : "Log in with Spotify for the second user"}
    </Button>
);

export default LoginButton;
